//import './App.css';
import Axios from 'axios';


import { useAuth } from "./auth";
import {BrowserRouter as Router, Switch, Route, Link, useNavigate, useParams} from 'react-router-dom';


function CarDetails(props) {

  const params = useParams()

  const [data, setData] = useState([])

  useEffect(() => {
    const info = async () => {
    

      Axios.post("http://localhost:3001/api/Cars", {
      
    }).then((response) => {
      
      setData(response.data)
      
      console.log("response")
    })}

    info()
    
  })

  return (
      // <Router> 
      <><div>
      
    </div>
      
        <h1> Car Detail Page </h1>

        JSON.stringify({params})

        {
          data.map( (getD)=>(

            
            <div key={getD.regNumber}>
              <div className = "Car">
              <a href={"/CarDetails/"+getD.regNumber}>{getD.make} {getD.model}</a>
                <div className="Price"><strong>Price: </strong>{  getD.price  } per day</div>
                <div className="Picture"><strong></strong><img src={require(`../imgs/${  getD.photo  }`)} /> </div>
                
              </div>
              <br>
              
              </br>
                
            
            </div>
            

          )
          
          )
        }
        
      </>
  );}



export default CarDetails;
